import React from "react";
import logo from "./logo.svg";
import "./App.css";
import { f, auth, database, storage } from "./config/config.js";
import "bootstrap/dist/css/bootstrap.min.css";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import {
  Container,
  Row,
  Col,
  FormControl,
  Form,
  Button
} from "react-bootstrap";

// import React from 'react';
// import PropTypes from 'prop-types';
// import { map } from 'lodash';
// import { useSelector } from 'react-redux';
// import { useFirebase, useFirebaseConnect } from 'react-redux-firebase';
// import Dropzone from 'react-dropzone';

function App() {
  return (
    <div className='App'>
      <Navbar bg='light' variant='light' fixed='top'>
        <Navbar.Brand href='#home'>Navbar</Navbar.Brand>
        <Nav className='mr-auto'>
          <Nav.Link href='#home'>Home</Nav.Link>
          <Nav.Link href='#features'>Features</Nav.Link>
          <Nav.Link href='#pricing'>Pricing</Nav.Link>
        </Nav>
        <Form inline>
          <FormControl type='text' placeholder='Search' className='mr-sm-2' />
          <Button variant='outline-primary'>Search</Button>
        </Form>
      </Navbar>
      <Container fluid={true}>
        <Row>
          <div
            style={{
              backgroundColor: "#ffffff",
              paddingTop: 100,
              width: 100,
              height: "100%",
              position: "absolute"
            }}
          >
            <ul style={{ listStyle: "none" }}>
              <li>
                <a href='#'>
                  <i
                    className='fa fa-angle-right'
                    style={{
                      fontSize: 40,
                      fontWeight: "bold",
                      color: "grey",
                      marginLeft: -36,
                      paddingBottom: 30
                    }}
                  ></i>
                </a>
              </li>
              <li>
                <a href='#'>
                  <i
                    className='fa fa-plus'
                    style={{ fontSize: 35, color: "grey", marginLeft: -36 }}
                  ></i>
                </a>
              </li>
              <li>
                <a href='#'>
                  <i
                    className='fa fa-th'
                    style={{ fontSize: 35, color: "grey", marginLeft: -36 }}
                  ></i>
                </a>
              </li>
              <li>
                <a href='#'>
                  <i
                    className='fa fa-user'
                    style={{ fontSize: 35, color: "grey", marginLeft: -36 }}
                  ></i>
                </a>
              </li>
              <li>
                <a href='#'>
                  <i
                    className='fa fa-phone'
                    style={{ fontSize: 35, color: "grey", marginLeft: -36 }}
                  ></i>
                </a>
              </li>
              <li>
                <a href='#'>
                  <i
                    className='fa fa-cog'
                    style={{ fontSize: 35, color: "grey", marginLeft: -36 }}
                  ></i>
                </a>
              </li>
            </ul>
          </div>
          <div
            style={{
              height: 1000,
              width: "100%",
              //float: "left",
              //position: "relative"
              background: "#f5f5f5",
              marginLeft: 100
            }}
          >
            <Container>
              <Row
                style={{
                  //inside the dashboard
                  marginTop: 150
                }}
              >
                <Col md={12}>
                  <h2 style={{ color: "#222222", textAlign: "left" }}>
                    Project Title Holder
                  </h2>
                </Col>
              </Row>
              <Row
                style={{
                  //inside the dashboard
                  marginTop: 20
                }}
              >
                <Col md={1}>
                  <Button variant='primary'>Edit</Button>
                </Col>
                <Col md={3}>
                  <Button variant='primary'>Primary</Button>
                </Col>
                <Col md={3}>
                  <Button variant='primary'>Primary2</Button>
                </Col>
                <Col md={5}></Col>
              </Row>
              <Row
                style={{
                  //inside the dashboard
                  marginTop: 50
                }}
              >
                <Col md={3}>
                  <div
                    style={{
                      backgroundColor: "#ffffff",
                      height: 120,
                      width: "100%",
                      borderRadius: 5
                    }}
                  >
                    <p>hi</p>
                  </div>
                </Col>
                <Col md={3}>
                  <div
                    style={{
                      backgroundColor: "#ffffff",
                      height: 120,
                      width: "100%",
                      borderRadius: 5
                    }}
                  >
                    <p>hi</p>
                  </div>
                </Col>
                <Col md={3}>
                  <div
                    style={{
                      backgroundColor: "#ffffff",
                      height: 120,
                      width: "100%",
                      borderRadius: 5
                    }}
                  >
                    <p>hi</p>
                  </div>
                </Col>
                <Col md={3}>
                  <div
                    style={{
                      backgroundColor: "#ffffff",
                      height: 120,
                      width: "100%",
                      borderRadius: 5
                    }}
                  >
                    <p>hi</p>
                  </div>
                </Col>
              </Row>
              <Row
                style={{
                  //inside the dashboard
                  marginTop: 50
                }}
              >
                <Col md={6}>
                  <div
                    style={{
                      backgroundColor: "#ffffff",
                      height: 300,
                      width: "100%",
                      borderRadius: 5
                    }}
                  >
                    <p>hi</p>
                  </div>
                </Col>
                <Col md={6}>
                  <div
                    style={{
                      backgroundColor: "#ffffff",
                      height: 300,
                      width: "100%",
                      borderRadius: 5
                    }}
                  >
                    <p>hi</p>
                  </div>
                </Col>
              </Row>
            </Container>
          </div>
        </Row>
      </Container>
    </div>
  );
}

export default App;
